import React from 'react';
import './footer.scss';

function Footer() {
  return (
      <footer className="App-footer fixed-bottom d-flex flex-row justify-content-between">
        <div className="p-2">MLI</div>
        <div className="p-2">MLI</div>
        <div className="p-2">MLI</div>
      </footer>
  );
}

export default Footer;
